import React, { Component } from "react";
import Fade from "react-reveal";

const Footer = () => {
  const mainn = {
    name: "Nordic-Giant Project",
    description:
      "I am a web development engineer and I use react and vue.js to develop pages. This project is a resume template that can be used as the project home page or resume page",
    image: "profilepic.jpg",
    bio: "Use this bio section as your way of describing yourself and saying what you do, what technologies you like to use or feel most comfortable with, describing your personality, or whatever else you feel like throwing in.",
    contactmessage:
      "Here is where you should write your message to readers to have them get in contact with you.",
    email: "youremailhere@gmail.com",
    phone: "555-555-5555",
    github: "https://github.com/nordicgiant2/react-nice-resume",
    project: "https://github.com/nordicgiant2/react-nice-resume",
    address: {
      street: "(Your Street)",
      city: "(Your City)",
      state: "(Your State)",
      zip: "(Your Zip/Postal Code)",
    },
    website: "http://www.timbakerdev.com",
    resumedownload: "http://timbakerdev.com",
  };

  const social = [
    {
      name: "facebook",
      url: "https://www.facebook.com/saleh.alsaleh.7737769/",
      className: "fa fa-facebook",
    },
    {
      name: "twitter",
      url: "http://twitter.com",
      className: "fa fa-twitter",
    },
    {
      name: "linkedin",
      url: "https://www.linkedin.com/in/tim-baker-8420009a/",
      className: "fa fa-linkedin",
    },
    {
      name: "instagram",
      url: "http://instagram.com/tbaker_x",
      className: "fa fa-instagram",
    },
    {
      name: "github",
      url: "https://github.com/MHD-Saleh",
      className: "fa fa-github",
    },
  ];

  const networkss = social.map(function (network) {
    return (
      <li key={network.name}>
        <a href={network.url}>
          <i className={network.className}></i>
        </a>
      </li>
    );
  });

  return (
    <footer>
      <div className="row">
        <Fade bottom>
          <div className="twelve columns">
            <ul className="social-links">{networkss}</ul>

            <ul className="copyright">
              <li>&copy; Copyright 2022 MHD Saleh</li>
            </ul>
          </div>
        </Fade>

        <div id="go-top">
          <a className="smoothscroll" title="Back to Top" href="#home">
            <i className="icon-up-open"></i>
          </a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;

class Footerr extends Component {
  render() {
    if (!this.props.data) return null;

    const networks = this.props.data.social.map(function (network) {
      return (
        <li key={network.name}>
          <a href={network.url}>
            <i className={network.className}></i>
          </a>
        </li>
      );
    });

    return (
      <footer>
        <div className="row">
          <Fade bottom>
            <div className="twelve columns">
              <ul className="social-links">{networks}</ul>

              <ul className="copyright">
                <li>&copy; Copyright 2021 Nordic Giant</li>
                <li>
                  Design by{" "}
                  <a title="Styleshout" href="http://www.styleshout.com/">
                    Styleshout
                  </a>
                </li>
              </ul>
            </div>
          </Fade>

          <div id="go-top">
            <a className="smoothscroll" title="Back to Top" href="#home">
              <i className="icon-up-open"></i>
            </a>
          </div>
        </div>
      </footer>
    );
  }
}
